  const { text } = useSelector((state) => state.users);

  const dispatch = useDispatch();

  useEffect(() => {
    fetch("http://localhost:3001/users")
      .then((res) => res.json())
      .then((res) => {
        dispatch(userData(res.users));
      });
  }, [dispatch]);

  return (
    <div className="form-label2">
      {userData.map((item) => (
        <h2>
          {" "}
          {item.id} {item.email}
        </h2>
      ))}
    </div>
  );
}

export default Dashboard;
